import React from 'react';
import AddRecipeForm from '../AddRecipeForm';

const AddRecipePage = () => {
    return (
        <div>
            <h1>Add Recipe</h1>
            <AddRecipeForm />
        </div>
    );
}

export default AddRecipePage;
